import React from "react";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="left-logo">
        <img src="././img/logo.svg" alt="Logo" />
      </div>
      <div className="center-email">
        <a href="mailto:info@example.com">geral@studio101.pt</a>
      </div>
      <div className="right-social">
        <a href="https://www.youtube.com" target="_blank">
          <img src="././img/youtube" alt="Youtube" />
        </a>
        <a href="https://www.instagram.com" target="_blank">
          <img src="././img/instagram" alt="Instagram" />
        </a>
        <a href="https://www.behance.com" target="_blank">
          <img src="././img/behance" alt="Behance" />
        </a>
      </div>
    </footer>
  );
};

export default Footer;
